    env:
      TUXSUITE_TOKEN: ${{ secrets.TUXSUITE_TOKEN }}
    steps:
    - uses: actions/checkout@v2
    - name: tuxsuite
      run: tuxsuite build-set --set-name distribution_configs --json-out builds.json --tux-config tuxsuite/5.15.tux.yml || true
